import "./App.css";
import Post from "./Post";
import Header from "./Header";
import {Route, Routes } from "react-router-dom";
import Layout from "./Layout";

function App() {
  return (
    <Routes>
      <Route path="/" element={<Layout/>}></Route>
      <Route
        index element={
            <Post />
        }
      />

<Route
        path="/login" element={
          <Login/>
        }
      />
    </Routes>
  );
}

export default App;
